descricao:
Aprovado com alterações apresentadas pelo autor.
Informações requeridas após a aprovação das alterações:
1. O valor da despesa discricionária (RP 2 e 3) autorizada na Lei Orçamentária para o exercício de 2018 por Instituição Federal de Ensino Superior;
2. O valor contingenciado de orçamento discricionário (RP 2 e 3) para cada Instituição Federal de Ensino Superior, após avaliação do primeiro bimestre de 2018, de acordo com o Decreto 9.323/2018;
3. O valor contingenciado de orçamento discricionário (RP 2 e 3) para cada Instituição Federal de Ensino Superior, após avaliação do primeiro bimestre de 2019, de acordo com o Decreto 9.741/2019; e
4. O valor executado em cada Instituição Federal de Ensino Superior até o momento com os recursos discricionários previstos para o exercício de 2019.

Aprovado com a  inclusão dos seguintes convidados: 
- Representante da ONG Conectas Direitos Humanos;
- Procuradora Cristiane Lopes, Coordenadora Nacional do Grupo de Trabalho sobre Migrações do Ministerio Publico do Trabalho;
- Representante da "Operação Acolhida" das Forças Armadas.

Aprovado, contra o voto do Deputado Lucas Gonzaeles, com a retirada do convite à Diretora Institucional do DETRAN/RS e com as seguintes inclusões e alterações propostas pelos Deputados Marcelo Nilo, Mauro Lopes e Mauro Nazif:
- Secretário da Previdência social, Sr. Rogério Marinho;
- Presidente da Federação dos Policiais Rodoviários Federais, Sr. Deolindo Carniel;
- Representante do Ministério da Infraestrutura;
- Representante do Ministério da Saúde;
- Representante de Associação Nacional dos Médicos do DETRAN;
- Representante da Federação Nacional das cooperativas de Trabalho dos Médicos e Psicólogos Peritos de Trânsito - FENACTRAN;
- Representante da União de Ciclistas do Brasil - UCB;
- Presidente da Associação de Médicos e Psicólogos Peritos do Trânsito do Brasil -  ANPETRA e
- Representante do Sindicato das Seguradoras, Previdência e Capitalização do Estado de São Paulo - Sindsegsp.

Aprovado, com as seguintes alterações:
- inclusão, como convidado, do Presidente da Associação Nacional das Defensoras e Defensores Públicos - ANADEP, Senhor Defensor Público Pedro Paulo Coelho, por sugestão do Deputado Paulo Ramos;
- inclusão, como convidados, do Presidente do Colégio dos Tribunais Regionais Federais, do Presidente do Colégio dos Tribunais de Justiça, do Presidente do Colégio dos Tribunais Regionais Eleitorais e do Presidente do Colégio dos Tribunais Regionais do Trabalho, por sugestão do autor;
- realização de Seminários nos Estados da Federação, por sugestão do Deputado Alex Manente.
